import React from "react";
import { createGlobalStyle } from "styled-components";

import ToDoList from "./components/ToDoList";
import "./App.css";

const GlobalStyle = createGlobalStyle`
max-width: 300px;
width: 100%;
border: 1px solid red;

`;

function App() {
    return (
        <>
            <GlobalStyle>
                <ToDoList />
            </GlobalStyle>
        </>
    );
}

export default App;
